import collections
import heapq


class Solution:
    def corpFlightBookings(self, bookings: list[list[int]], n: int) -> list[int]:
        heapq.heapify(bookings)
        ans=[0]*n
        def add(begin,end,v):
            for i in range(begin,end+1):
                ans[i-1]+=v
            
        while len(bookings)>0:
            if len(bookings)<2:
                item=heappop(bookings)
                add(item[0],item[1],item[2])
                break
            item1=heapq.heappop(bookings)
            item2=heapq.heappop(bookings)
            if item1[:2]==item2[:2]:
                item1[2]+=item2[2]
                heapq.heappush(bookings,item1)
            if item1[1]<=item2[0] or item2[1]<=item1[1]:
                # 两者不相交
                add(item1[0],item1[1],item1[2])
                heapq.heappush(bookings,item2)
            elif item1[1]>item2[0]:
                # 两者相交 拆分出3个 
                # add(item1[0],item2[0],item1[2])
                i2=[item2[0],item1[1],item1[2]+item2[2]]
                i3=[item1[1],item2[1],item2[2]]
                ans[item1[1]-1]-=item2[2]
                ans[item2[0]-1]-=item1[2]
                heapq.heappush(bookings,[item1[0],item2[0],item1[2]])
                heapq.heappush(bookings,i2)
                heapq.heappush(bookings,i3)
                # print(bookings)
        return ans

